import styled from "styled-components";
import React, { Component } from "react";
import Slider from "react-slick";

export default function SectionProject() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <Slider {...settings}>
      <div>KEEP GOING</div>
      <div>
        <h3>KEEP GOING</h3>
      </div>
      <div>
        <h3>KEEP GOING</h3>
      </div>
      <div>
        <h3>KEEP GOING</h3>
      </div>
      <div>
        <h3>KEEP GOING</h3>
      </div>
      <div>
        <h3>KEEP GOING</h3>
      </div>
    </Slider>
  );
}

const Container = styled.div`
  width: 100%;
  position: relative;
`;

const Wrap = styled.div`
  width: 100%;
`;

const TextMain = styled.li`
  margin: 40px 70px;
  font-weight: ${({ theme }) => theme.fonts.weightExtra};
  font-size: 110px;
`;

const TextWhite = styled.li`
  margin: 40px 70px;
  font-weight: ${({ theme }) => theme.fonts.weightExtra};
  font-size: 110px;
`;
